INSERT INTO `sys_operate_log` VALUES (24, '861e3846-9982-4dac-aaef-9363a47cc79f', 121, '通知公告', '创建通知公告', 2, '', '', 'POST', '/api/system/notice/create', '127.0.0.1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/91.0.4472.77 Safari/537.36 Edg/91.0.864.37', 'CommonResult cn.iocoder.dashboard.modules.system.controller.notice.SysNoticeController.createNotice(SysNoticeCreateReqVO)', '{\"reqVO\":{\"title\":\"心简单了，人就快乐了\",\"type\":1,\"content\":\"<p>不知道你有没有这样的时候，突然觉得<a href=\\\"https://www.bidushe.com/qinggan/suibi/\\\" rel=\\\"noopener noreferrer\\\" target=\\\"_blank\\\" style=\\\"color: rgb(37, 37, 37);\\\">心情</a>低落，觉得事情都在朝着越来越糟糕的境况发展，觉得所有一切都在和自己过不去，莫名地想哭，莫名地脆弱。</p><p>我们不知道自己将来会变成什么模样，不知道自己会拥有什么样的<a href=\\\"https://www.bidushe.com/jingdian/suibi/\\\" rel=\\\"noopener noreferrer\\\" target=\\\"_blank\\\" style=\\\"color: rgb(37, 37, 37);\\\">生活</a>，不知道什么时候才能过上自己钟意的那种日子。</p><p>这个时代走得很快，我们每天都会接收到很多很多讯息。看得太多，可并非所有想要的都能得到，于是我们越来越容易变得焦躁。</p><p>可你有没有想过，我们所追求的，从来都是<a href=\\\"https://www.bidushe.com/diary/xingfu/\\\" rel=\\\"noopener noreferrer\\\" target=\\\"_blank\\\" style=\\\"color: rgb(37, 37, 37);\\\">幸福</a>和<a href=\\\"https://www.bidushe.com/diary/kuaile/\\\" rel=\\\"noopener noreferrer\\\" target=\\\"_blank\\\" style=\\\"color: rgb(37, 37, 37);\\\">快乐</a>，而不是烦闷和苦恼。当你把心静一静，让一切回归原点就会发现，生活的累一小半来源于生存，一大半来源于自己。心若是小了，小事也成了大事，塞得满满当当；而把心放宽了，大事也成了小事，可以轻巧地解决掉。</p><p>心越简单，人越快乐。</p>\",\"status\":0,\"readed\":\"\"}}', '2021-06-04 15:04:59', 49, 0, '', '15', '121', '2021-06-04 15:04:59', '121', '2021-06-04 15:04:59', b'0');
INSERT INTO `sys_operate_log` VALUES (25, 'd1718bb8-7b28-4afd-8c3b-21624fd702b6', 121, '通知公告', '创建通知公告', 2, '', '', 'POST', '/api/system/notice/create', '127.0.0.1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/91.0.4472.77 Safari/537.36 Edg/91.0.864.37', 'CommonResult cn.iocoder.dashboard.modules.system.controller.notice.SysNoticeController.createNotice(SysNoticeCreateReqVO)', '{\"reqVO\":{\"title\":\"全国高校智能制造工程、机器人工程和人工智能等相关专业师资高级研修班在我校举办\",\"type\":2,\"content\":\"<p class=\\\"ql-align-justify\\\">\\t5月28日至31日，全国高校智能制造工程、机器人工程和人工智能等相关专业师资高级研修班在我校举办。中国高等教育学会监事长、吉林省教育厅原党组书记、高校工委书记孙维杰，清华大学基础工业训练中心主任、教育部高等学校工程训练教学指导委员会副主任委员李双寿，中组部“万人计划”创新创业人才、国家科技部科技创新创业领军人才、浙江大学制造技术及装备自动化研究所所长傅建中等9位来自清华大学、哈尔滨工业大学、浙江大学、同济大学、华中科技大学、吉林大学、东南大学、浙江师范大学的智能制造工程、机器人工程和人工智能等领域知名专家学者出席研修班并做专题报告。我校副校长吴国庆教授出席研修班。</p><p class=\\\"ql-align-justify\\\">\\t开班仪式上，中国高等教育学会监事长、吉林省教育厅原党组书记、高校工委书记孙维杰致辞。他代表中国高等教育学会、中国高等教育培训中心向研修班的开班表示热烈祝贺，向参加研修的各位专家老师表示热烈欢迎。他认为研修班意义重大，为我国高校智能制造、机器人工程和人工智能等相关专业建设起到积极推动作用；使命光荣，顺应行业发展趋势，服务于国家发展规划，共同推进人工智能事业的发展；影响深远，开阔学员的视野，提升学员的站位，从而促进这一领域的高质量发展。他希望各位高校同仁能够好好珍惜学习机会，学有所思、学有所悟、学有所得，不虚此行，带着本次学习的思、悟、得，回到自己的岗位上，为我国的智能制造、机器人工业和人工智能专业建设添砖加瓦。</p><p class=\\\"ql-align-justify\\\">\\t我校吴国庆副校长做开幕报告。他从南通地理位置、南通“三张名片”、南通产业发展以及南通新一轮发展机遇四个部分介绍了南通的相关情况，使来自全国各地的参会人员对南通这座历史文化名城有了更进一步的了解。随后，他详细介绍了我校的基本办学情况、我校智能制造专业人才培养特色与成效、智能制造科研平台建设情况以及智能制造取得的主要科研成果。他指出，面对新一轮工业革命带来的诸多挑战与机遇，我校将抓住机遇、迎接挑战、校企协同，为智能制造行业培养更多、更优秀的人才。</p><p class=\\\"ql-align-justify\\\">\\t研修班上，清华大学基础工业训练中心主任、教育部高等学校工程训练教学指导委员会副主任委员李双寿，中组部“万人计划”创新创业人才、国家科技部科技创新创业领军人才、浙江大学制造技术及装备自动化研究所所长傅建中，工信部电子科技委员会委员、同济大学工业4.0学习工厂主任陈明，北京昊科教育技术研究院院长、浙江师范大学三级教授陆爽，中国人工智能学会智能机器人专业委员会秘书长、哈尔滨工业大学机器人研究所副所长李瑞峰，华中科技大学国家CAD支撑软件工程技术研究中心（武汉）副主任、机械学院副院长王书亭，吉林大学机械与航空航天工程学院副院长、国家级机械虚拟仿真实验教学中心主任曲兴田，浙江师范大学工学院副院长、浙江省流体与传热技术国际科技合作基地负责人王冬云，东南大学工程训练中心主任陈建松分别作专题报告。</p><p class=\\\"ql-align-justify\\\">\\t本次研修班旨在贯彻落实习近平总书记关于教育的重要论述和全国教育大会精神，提高高校专业教师的数字化、网络化和智能化专业技术水平和教学实践能力，全面提高智能制造工程、机器人工程和人工智能等专业的建设水平和应用型工程技术人才的培养质量，进一步明确各相关专业人才培养体系和人才培养目标。研修班由中国高等教育培训中心主办，南通理工学院承办，北京昊科教育技术研究院协办。中国高等教育学会和武汉大学是本次研修班的指导单位。研修班共吸引全国50多所高校100余人参加。</p><p class=\\\"ql-align-justify\\\">\\t研修班全体人员还参观了我校实验室、人才培养展览馆、校史馆以及党建思政馆。</p><p class=\\\"ql-align-justify\\\">\\t我校机械工程学院院长李业农、电气与能源工程学院院长吴建国、计算机与信息工程学院院长邱建林分阶段主持研修班。</p><p><br></p>\",\"status\":0,\"readed\":\"\"}}', '2021-06-04 15:12:41', 40, 0, '', '16', '121', '2021-06-04 15:12:41', '121', '2021-06-04 15:12:41', b'0');
